import Link from 'next/link';
import Header from '../components/Header';
import Layout from '../components/MyLayout';
import { Table } from 'antd';

<link rel="stylesheet" href="../styles/commonStyles.css" />

const PostLink = props => (
    <li>
        <Link href={`/posts?title=${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </li>
)

const dataSource = [
    {
        key: '1',
        name: 'Mike',
        age: 32,
        address: '10 Downing Street',
    },
    {
        key: '2',
        name: 'John',
        age: 42,
        address: '10 Downing Street',
    },
];

const columns = [
    {
        title: 'Name',
        dataIndex: 'name',
        key: 'name',
    },
    {
        title: 'Age',
        dataIndex: 'age',
        key: 'age',
    },
    {
        title: 'Address',
        dataIndex: 'address',
        key: 'address',
    },
];

export default function Blog() {
    return (
        <>
            <Layout>
                <h1>My Blog</h1>
                <ul>
                    <PostLink title="Hello Next.js page 1" />
                    <PostLink title="Awesome page 2" />
                    <PostLink title="Curfew today page 3" />
                </ul>
            </Layout>
            <Table dataSource={dataSource} columns={columns} />;
        </>
    )
}
